import React from 'react';


function Cart({ initialItems }) {
    console.log(initialItems)
    return (
        <div>
            <h1>
                I am cart
            </h1>
            <ul>
                {initialItems.map(item => (
                    
                        <li>
                            product: {item.product}, price: {item.price}
                        </li>
                ))}
            </ul>
        </div>
    )
}


export default Cart;


const items = [
    {id: 1, product: 'Un producto', price: 2.34, qty: 2 },
    {id: 2, product: 'Un producto', price: 2.34, qty: 2 },
    {id: 3, product: 'Un producto', price: 2.34, qty: 2 },
]
